import React, { useLayoutEffect } from "react";
import { effect } from "../animation";

export default function Card({ newData, poster }) {
  useLayoutEffect(effect, [window.scrollY]); // 의존성 배열 내부의 값이 변할 때 마다 LayoutEffect 실행

  return (
    <>
      {poster.map((el, idx) => {
        return (
          <div className="wheel__card" key={el.idx}>
            <div></div>
            <div></div>
            <img src={el} alt="pic"></img>
          </div>
        );
      })}
    </>
  );
}
